var title_f15_4_15438="Supplementation after RYGB";
var content_f15_4_15438=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F79014&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F79014&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Supplementation after Roux-en-Y gastric bypass and gastric sleeve procedures",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Supplement",
"       </td>",
"       <td class=\"subtitle1\">",
"        Dosage*",
"       </td>",
"       <td class=\"subtitle1\">",
"        Representative preparations",
"       </td>",
"       <td class=\"subtitle1\">",
"        Monitoring",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"       <td class=\"subtitle1\">",
"        Comment",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"5\">",
"        Multivitamin with minerals and iron, one or two per day, each chewable tablet (or liquid equivalent) minimally containing",
"        <sup>",
"         &Delta;",
"        </sup>",
"        :",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Vitamin A",
"       </td>",
"       <td>",
"        500 mcg (1600 units)",
"       </td>",
"       <td rowspan=\"10\">",
"        <p>",
"         Multivitamins with minerals (including iron):",
"        </p>",
"        <p>",
"         Representative trade names (US) include: Centrum&reg; (NOT Centrum Silver&reg; as mineral content is too low), Centrum Performance&reg;, One-A-Day Maximum&reg;, Equate Complete Multivitamin for Adults",
"        </p>",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Vitamin B1 (thiamine)",
"       </td>",
"       <td>",
"        1.2 mg",
"       </td>",
"       <td>",
"        <p>",
"         Thiamine (optional)",
"        </p>",
"        <p>",
"         Erythrocyte transketolase activity (optional)",
"        </p>",
"       </td>",
"       <td>",
"        Thiamine deficiency has been associated with intractable vomiting following bariatric surgery and Wernicke encephalopathy has been reported. See text.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Vitamin E",
"       </td>",
"       <td>",
"        10 mg",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Vitamin K",
"       </td>",
"       <td>",
"        Male: 120 mcg; Female 90 mcg",
"       </td>",
"       <td>",
"        &nbsp;Prothrombin Time/INR (optional as a measure of vitamin K status)",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Iron",
"       </td>",
"       <td>",
"        10 mg elemental",
"       </td>",
"       <td>",
"        TIBC, ferritin, transferrin, CBC",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Folic acid",
"       </td>",
"       <td>",
"        400 mcg",
"       </td>",
"       <td>",
"        RBC folate (optional)",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Biotin",
"       </td>",
"       <td>",
"        30 mcg",
"       </td>",
"       <td>",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Selenium",
"       </td>",
"       <td>",
"        55 mcg",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Zinc",
"       </td>",
"       <td>",
"        Male: 11 mg; Female: 8 mg",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        Zinc deficiency may be associated with chronic diarrhea",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Copper",
"       </td>",
"       <td>",
"        2 mg",
"       </td>",
"       <td>",
"        Serum copper",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"5\">",
"        Calcium and vitamin D",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <p>",
"         Calcium citrate",
"        </p>",
"        <p>",
"         Calcium carbonate (see comment)",
"        </p>",
"       </td>",
"       <td>",
"        1200 to 1500 mg (elemental calcium) per day preferably in&nbsp;two equally divided doses",
"       </td>",
"       <td>",
"        <p>",
"         Elemental calcium content:",
"        </p>",
"        <p>",
"         Tablets, capsules: 180, 200, 250 mg",
"        </p>",
"        <p>",
"         Effervescent tablet: 500 mg",
"        </p>",
"        <p>",
"         Oral suspension: 760 mg per 5 mL",
"        </p>",
"       </td>",
"       <td rowspan=\"2\">",
"        <p>",
"         25-Hydroxyvitamin D",
"        </p>",
"        <p>",
"         Intact PTH (optional)",
"        </p>",
"       </td>",
"       <td>",
"        Calcium citrate preparations may be better absorbed than calcium carbonate under conditions of reduced gastric acidity but require consumption of more tablets. Do not take within two hours of iron supplement.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Vitamin D3 (cholecalciferol)",
"       </td>",
"       <td>",
"        800 units per day",
"       </td>",
"       <td>",
"        <p>",
"         Tablets, capsules: 400, 1000, 2000 units",
"        </p>",
"        <p>",
"         Chewable tablet: 400 units",
"        </p>",
"        <p>",
"         Oral drops: 400 units per drop",
"        </p>",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"5\">",
"        Iron and ascorbic acid",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <p>",
"         Ferrous fumarate",
"        </p>",
"        <p>",
"         Ferrous gluconate",
"        </p>",
"        <p>",
"         Ferrous sulfate",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         40 to 65 mg (elemental iron) per day for premenopausal women",
"        </p>",
"        <p>",
"         18 to 27 mg (elemental iron) per day for others",
"        </p>",
"        <p>",
"         May be included in multivitamin",
"        </p>",
"       </td>",
"       <td>",
"        Combination (eg, Vitron-C&reg;) ferrous fumarate (65 mg elemental) with ascorbic acid (125 mg); ferrous sulfate oral liquid: 44 or 60 mg elemental per 5 mL; ascorbic acid liquid: 100 mg/mL",
"       </td>",
"       <td>",
"        Iron studies, ferritin, CBC",
"       </td>",
"       <td>",
"        Iron supplementation is based on monitoring. Iron is contained in the multivitamin-mineral tablet and additional supplementation is not recommended unless the patient has documented iron deficiency. If additional supplementation indicated, 100 to 150 mg ascorbic acid enhances iron absorption under conditions of reduced gastric acidity. Do not take within two hours of calcium supplement.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"5\">",
"        Vitamin B12 (cyanocobalamin)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Oral tablet",
"       </td>",
"       <td>",
"        500 to 1000 mcg per day",
"       </td>",
"       <td>",
"        Tablet: 250, 500, 1000 mcg",
"       </td>",
"       <td rowspan=\"5\">",
"        CBC, Vitamin B12 (methylmalonic acid, homocysteine optional)",
"       </td>",
"       <td rowspan=\"5\">",
"        B12 deficiency is a frequent complication within one year of RYGB surgery in absence of adequate supplementation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Sublingual or buccal tablet",
"       </td>",
"       <td>",
"        500 to 1000 mcg per day",
"       </td>",
"       <td>",
"        Sublingual tablet or lozenge 500 mcg",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Sublingual spray",
"       </td>",
"       <td>",
"        400 mcg per day",
"       </td>",
"       <td>",
"        200 mcg per spray",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Intranasal spray",
"       </td>",
"       <td>",
"        500 mcg once per week",
"       </td>",
"       <td>",
"        500 mcg per 0.1 mL intranasal spray",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Intramuscular injection",
"       </td>",
"       <td>",
"        1000 mcg IM once per month or 3000 mcg IM once every&nbsp;six months",
"       </td>",
"       <td>",
"        1000 mcg per mL injection",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    Patients with deficiency states will need treatment beyond these recommendations.",
"    <div class=\"footnotes\">",
"     IM: intramuscularly; TIBC: total iron binding capacity; RYGB: Roux-en-Y gastric bypass; PTH: parathyroid hormone; CBC: complete blood count; RBC: red blood cell.",
"     <br>",
"      * Maintenance dosage for adult, oral administration, unless specified otherwise.",
"      <br>",
"       <font class=\"bullet\">",
"        &bull;",
"       </font>",
"       Routine lab monitoring at baseline and every&nbsp;three to&nbsp;six months during first year, then annually thereafter. See text for additional information.",
"       <br>",
"        &Delta; Multivitamin should provide US Food and Drug Administration daily recommended intake for other vitamins and minerals. Iron containing multivitamin preparations that do not contain calcium may be preferred. Calcium should be administered as a separate preparation at least two hours before or after multivitamin with iron supplements to increase absorption.",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from:",
"     <ol>",
"      <li>",
"       Mechanick JI, Kushner RF, Sugerman HJ, et al. American Association of Clinical Endocrinologists, The Obesity Society, and American Society for Metabolic &amp; Bariatric Surgery Medical guidelines for clinical practice for the perioperative nutritional, metabolic, and nonsurgical support of the bariatric surgery patient. Endocr Pract 2008; 14 Suppl 1:1.",
"      </li>",
"      <li>",
"       Snyder-Marlow G, et al. Nutrition Care for patients undergoing laparoscopic sleeve gastrectomy for weight loss. J Am Diet Assoc 2010; 110:600.",
"      </li>",
"     </ol>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
